import React, { Component } from "react";
class Home extends Component {
  render() {
    return (
      <div id="slider">
      <figure>
        <img src="https://mdbootstrap.com/img/Photos/Slides/img%20(70).jpg" />
        <img src="https://mdbootstrap.com/img/Photos/Slides/img%20(129).jpg"/>
        <img src="https://mdbootstrap.com/img/Photos/Slides/img%20(130).jpg"/>
        <img src="ankor-wat.jpg" alt/>
        <img src="austin-fireworks.jpg" alt/>
      </figure>
    </div>

    );
  }
}

export default Home;
